import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-rental-agreement',
  templateUrl: './rental-agreement.component.html',
  styleUrls: ['./rental-agreement.component.css']
})
export class RentalAgreementComponent {
  carId:any;
  rentalDuration:any
  constructor(private router:ActivatedRoute,private userService:Use){

  }
  ngoninit(){
      this.router.queryParams.subscribe(params=>{
      this.carId=params['carId'];
      this.rentalDuration=params['rentalDuration'];
      console.log(this.carId);
      console.log(this.rentalDuration);
  });
}
}
